function Jiujitsu() {





return (


    <div className="foot">

    <center>
        <img src="https://scontent-ord5-1.xx.fbcdn.net/v/t39.30808-6/334247507_718371939740967_1421760906699961986_n.jpg?_nc_cat=109&ccb=1-7&_nc_sid=8bfeb9&_nc_ohc=dOc74gup_J0AX9JDH5J&_nc_ht=scontent-ord5-1.xx&oh=00_AfD6dcPIROmPEyCLYq_LPg3mFGZHbBmPrsDY8ado1i9z-A&oe=645A5E93" alt="https://scontent-ord5-1.xx.fbcdn.net/v/t39.30808-6/334247507_718371939740967_1421760906699961986_n.jpg?_nc_cat=109&ccb=1-7&_nc_sid=8bfeb9&_nc_ohc=dOc74gup_J0AX9JDH5J&_nc_ht=scontent-ord5-1.xx&oh=00_AfD6dcPIROmPEyCLYq_LPg3mFGZHbBmPrsDY8ado1i9z-A&oe=645A5E93" />
         <img src="https://images.tapology.com/gyms/logos/1168/profile/1168-chicago-fight-team.jpg?1656434969" alt="https://images.tapology.com/gyms/logos/1168/profile/1168-chicago-fight-team.jpg?1656434969" />


        <h2>Jiu-Jitsu</h2>
        <h3>Welcome to Chicago Fight Team's Jiu-Jitsu Program!</h3>
        <p>Our program is designed for individuals of all levels who are passionate about learning and practicing Brazilian Jiu-Jitsu. Whether you are a beginner or an advanced practitioner, our world-class instructors are dedicated to helping you achieve your goals and become the best version of yourself.

At Chicago Fight Team, we believe that Jiu-Jitsu is not just a sport but a way of life. Our program is based on the principles of respect, discipline, and perseverance, which we believe are essential for achieving success on and off the mat. We take pride in creating a positive and inclusive training environment where everyone is welcome, and our members are more than just training partners, but also part of our extended family.

Our experienced instructors are passionate about sharing their knowledge and expertise with our members. They offer a structured curriculum that covers all aspects of Jiu-Jitsu, including fundamental techniques, advanced techniques, live sparring, and competition preparation. Our program also includes specialized classes, such as self-defense, women's only classes, and kids' classes, which are tailored to meet the specific needs of each group.

At Chicago Fight Team, we believe that Jiu-Jitsu is not only a great workout but also an excellent way to improve your overall health and wellbeing. Our program will help you develop strength, flexibility, endurance, and agility, while also boosting your confidence, reducing stress, and enhancing your mental focus.

We invite you to come and experience the world-class Jiu-Jitsu program at Chicago Fight Team. Whether you are looking to compete at the highest level, or just want to learn a new skill and meet new people, we have something for everyone. Sign up for a free trial today and discover the benefits of Jiu-Jitsu for yourself.</p>

         <img src="https://scontent-ord5-2.xx.fbcdn.net/v/t1.6435-9/197183453_10165206359765058_6480982257001251006_n.jpg?_nc_cat=105&ccb=1-7&_nc_sid=8bfeb9&_nc_ohc=Itjc0hsAogEAX9K_daf&_nc_ht=scontent-ord5-2.xx&oh=00_AfDKAXsohSunkDYw6MgNoyUIgglegewJ5Ys1z5eiF2MDow&oe=647BCFD9" alt="https://scontent-ord5-2.xx.fbcdn.net/v/t1.6435-9/197183453_10165206359765058_6480982257001251006_n.jpg?_nc_cat=105&ccb=1-7&_nc_sid=8bfeb9&_nc_ohc=Itjc0hsAogEAX9K_daf&_nc_ht=scontent-ord5-2.xx&oh=00_AfDKAXsohSunkDYw6MgNoyUIgglegewJ5Ys1z5eiF2MDow&oe=647BCFD9" />

    </center>
    <p>jiujitsu stuff</p>
    </div>


    );
}


export default Jiujitsu;
